      "title": "Consent Form",
      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n  \u003Cdiv style=\"width: 90%;\"\u003E\n    \n    \u003Ch2\u003ETERMO DE CONSENTIMENTO INFORMADO\u003C\u002Fh2\u003E\n\n    \u003Ch3\u003ECompreensão do Processamento de Palavras e seu Significado\u003C\u002Fh3\u003E\n\n    \u003Cp class=\"text-left\"\u003EConvidamo-lo\u002Fa a participar numa investigação que visa compreender o modo como as pessoas leem e processam palavras, bem como o seu significado. Pedimos-lhe que leia este consentimento antes de concordar em participar do estudo.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EEsta investigação é liderada por Erin M. Buchanan (Professora na Universidade de Ciência e Tecnologia de Harrisburg, Estados Unidos) e em Portugal, coordenada por Patrícia Arriaga (Professora no Iscte-Instituto Universitário de Lisboa).\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EInformações básicas:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Neste estudo, será solicitado\u002Fa a responder a diferentes perguntas sobre palavras. Por exemplo, pode ser solicitado\u002Fa a definir as características de uma palavra, a avaliar a familiaridade com uma palavra, ou simplesmente a avaliar se uma sequência de letras é uma palavra verdadeira.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EProcedimentos:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    O estudo será realizado inteiramente online a partir de um computador ou laptop\u002Fnotebook com teclado. Irá receber instruções sobre as tarefas do estudo, as quais são apresentadas aleatoriamente para cada pessoa. Após concluir o estudo, terá oportunidade de aprender mais sobre o estudo e os objetivos da investigação. O estudo completo deverá demorar cerca de 30 minutos a ser concluído. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ERiscos e benefícios deste estudo:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Nenhuma informação que permita identificá-lo será associada a si e, portanto, as suas respostas serão anónimas. O estudo atual é semelhante a um jogo online, o qual pode causar alguma fadiga com base na tarefa que lhe pedimos para realizar.\n    \u003Cbr \u002F\u003E\n    Não há nenhum benefício direto para si ao participar neste estudo. No entanto, as suas respostas contribuirão para uma maior compreensão da linguagem e de processos de memória cognitiva.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ECompensação:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003EVocê pode ser compensado ao participar deste estudo por meio de seu pesquisador local. No caso de ter recebido o link para este estudo através da plataforma Clickworker, irá receber a respetiva compensação indicada na plataforma. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EConfidencialidade e partilha de dados:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Serão tomadas medidas para garantir que todas as informações fornecidas são anónimas. Os dados do projeto e do estudo serão disponibilizados publicamente para eventual utilização por parte de outros investigadores. No entanto, nenhum dado será associado diretamente à sua pessoa. O seu nome ou outras informações de identificação não serão inseridos no conjunto de dados e nenhuma referência será incluída em relatórios que possam vinculá-lo\u002Fa ao estudo. Em qualquer publicação, as informações serão fornecidas de forma a não ser identificado\u002Fa.\n    \n    \u003Cbr \u002F\u003E\n    Antes de partilhar os seus dados fora da equipa de investigação, qualquer informação potencialmente identificável será removida. Os dados anónimos podem ser usados pela equipa ou partilhados com outros investigadores, para fins de investigação no futuro. Os seus dados anónimos também podem ser disponibilizados em repositórios online como a plataforma Open Science Framework (correspondem a repositórios de dados de acesso gratuito que exigem registo para ter acesso), de modo a permitir que outros investigadores tenham acesso aos dados para posterior análise ou validação.\n\n    \u003Cbr \u002F\u003E\n    Tenha em atenção que os seus dados serão anónimos, o que significa que não é possível solicitar a sua remoção após concluir o estudo.\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ENatureza Voluntária da participação:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    A participação neste estudo é voluntária: A sua decisão em participar não afetará as suas relações atuais ou futuras com o Iscte-Instituto Universitário de Lisboa. Se decidir participar, é livre para não responder a nenhuma pergunta ou para desistir a qualquer momento.\n \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EContatos e Dúvidas:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Se tiver dúvidas nesta fase, ou após ter concluído o estudo, poderá entrar em contato com Patrícia Arriaga (patricia.arriaga@iscte-iul.pt) ou com a coordenadora da investigação Erin M. Buchanan (ebuchanan@harrisburgu.edu). Este estudo foi aprovado pelas Comissões de Ética de ambas as universidades. Ambas determinaram que este estudo cumpre as obrigações éticas de proteção de seres humanos envolvidos em investigação.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EPerguntas ou preocupações:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Este estudo foi aprovado pelas Comissões de Ética de ambas as universidades. Ambas determinaram que este estudo cumpre as obrigações éticas de proteção de seres humanos envolvidos em investigação.\n\n    \u003Cp class=\"text-left\"\u003E\u003Ca href=\"https:\u002F\u002Fosf.io\u002Fd3ktg\u002Fdownload\"\u003E Uma cópia dessas informações será fornecida mediante solicitação.\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\n    \u003C\u002Fdiv\u003E\n    \n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  Por favor, pressione \u003Ckbd\u003EBARRA DE ESPAÇO\u003C\u002Fkbd\u003E para consentir com o estudo e continuar.\n\u003C\u002Ffooter\u003E"
