      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n \n  \u003Cdiv style=\"width: 90%;\"\u003E\n      \n    \u003Ch2\u003EInstruções\u003C\u002Fh2\u003E\n    \u003Cp class=\"text-left\"\u003ENesta tarefa estamos interessados em compreender a forma como as pessoas processam palavras. Será convidado\u002Fa a visualizar e a avaliar palavras. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EAs palavras serão apresentadas no meio do ecrã. A tarefa consiste em identificar se a palavra no ecrã é verdadeira ou falsa.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003ESe reconhecer a palavra no ecrã, como por exemplo \u003Cb\u003E”FRIO”\u003C\u002Fb\u003E, pressione a tecla \u003Ckbd\u003E${ window.word_key }\u003C\u002Fkbd\u003E para indicar a palavra como sendo verdadeira. Se a palavra for inventada ou não fizer sentido, como por exemplo \u003Cb\u003E“CELOR”\u003C\u002Fb\u003E, pressione a tecla \u003Ckbd\u003E${ window.nonword_key }\u003C\u002Fkbd\u003E para indicar que a palavra é falsa. Durante a fase inicial de treino, será fornecido feedback. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EPedimos-lhe que responda o mais rápido possível e que seja preciso. Para cada palavra terá três segundos para responder.\n  \u003C\u002Fdiv\u003E\n\n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  Por favor, pressione a \u003Ckbd\u003EBARRA DE ESPAÇO\u003C\u002Fkbd\u003E para iniciar a fase de treino.\n\n\u003C\u002Ffooter\u003E",
